const ViewGeotiff = () => {

	const url2div = (url, element) => {
    var iframe = document.createElement('iframe');
    iframe.setAttribute('src', url);
    element.appendChild(iframe);
}
	const input_params = JSON.stringify({
		state:"ne,ok",
		grid:"1",
		date:"2012-6",
		elems:[{
			name:"maxt",
			interval:"mly",
			duration:"mly",
			reduce:"max",
		}],
		output:"image",
		image:{
			proj:"lcc",
			overlays:["county:1:gray","state:2:purple"],
			interp:"cspline",
			width:350,
			levels:[90,95,100,105,110],
		},
	});

	return (
		<>
			<a href={"http://data.rcc-acis.org/GridData?params="+input_params}>View map image</a>
			<a href="#" onclick='url2div({"http://data.rcc-acis.org/GridData?params="+input_params}, this)'>Click</a>
		</>
	);
}

export default ViewGeotiff;
